// import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
// import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import '../Components/Search.css';
import IC from '../image/IC logo.png'


function OffcanvasExample() {
 

  return (


    <>
      
      {[false].map((expand) => (
        <Navbar key={expand} bg="light" expand={expand} className="mb-3">
         
          <Container fluid>
            <img className="App-logo" src={IC} style={{width:"50", height:"50"}}/>
            <Navbar.Brand href="#">INDIAN CULTURE</Navbar.Brand>
            <form className="w-75 text-end">
               <input type="text" className="border" placeholder="Search your content here..." />
           </form>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />

            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >

           
           <form className="w-75 text-end">
               <input type="text" className="border" placeholder="Search your content here..." />
           </form>
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  INDIAN CULTURE 2.0
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Forts Of India</Nav.Link>
                  <Nav.Link href="#action2">Historic Cities</Nav.Link>
                  <Nav.Link href="#action2">Photo Essay</Nav.Link>
                  <Nav.Link href="#action2">Textile and Fabrics of India</Nav.Link>
                  <NavDropdown
                    title="Catagories"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">List1</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">List2</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action5">
                      Other Catagories
                    </NavDropdown.Item>
                  </NavDropdown>
                </Nav>

              </Offcanvas.Body>
              
            </Navbar.Offcanvas>
           
          </Container>

          <div style={{flex: 0, height: '6px', backgroundColor: 'black', margin: '30px'}} />

        </Navbar>
        
      ))}
    </>

  );


}


export default OffcanvasExample;
